    //创建 Day视图的数据
    public static List<EcgEntry> createEcgEntries(long timestamp, int length, int originEntrySize, float[] values) {
        List<EcgEntry> entries = new ArrayList<>();
        for (int i = originEntrySize; i < length + originEntrySize; i++) {
            if (i > originEntrySize) {
                timestamp = timestamp - TimeDateUtil.TIME_HOUR;
            }
            float mult = 0;
            float random = (float) (Math.random() * 1.5);
            int randomInt = (int) random;
            float value = random + mult;
            if (i != 0 && i % 12 == 0) {
                if (randomInt % 2 == 0) {
                    value += 1;
                } else {
                    value -= 1;
                }
            }
            value = Math.round(value);
            int type = BarEntry.TYPE_XAXIS_THIRD;
            if (i % 75 == 0) {
                type = BarEntry.TYPE_XAXIS_SPECIAL;
            } else if (i % 25 == 0) {
                type = BarEntry.TYPE_XAXIS_FIRST;
            } else if (i % 5 == 0) {
                type = BarEntry.TYPE_XAXIS_SECOND;
            }
            LocalDate localDateEntry = TimeDateUtil.timestampToLocalDate(timestamp);
            EcgEntry barEntry = new EcgEntry(i, value, timestamp, type);
            barEntry.localDate = localDateEntry;
            barEntry.values = modeListValue(i, values);
            entries.add(barEntry);
        }
        Collections.sort(entries);
        return entries;
    }

    private static List<Float> modeListValue(int i, float[] values) {
        List<Float> modeList = new ArrayList<>();
        int startIndex = i * 20;
        for (int j = startIndex; j < startIndex + 20; j++) {
            int index = j % values.length;
            modeList.add(values[index] + 1.8f);
        }
        return modeList;
    }

